import React from 'react';
import { useNavigate } from 'react-router-dom';
import { StyledBackButton } from './back-button.styled';

const BackButton = () => {
  const navigate = useNavigate();
  const goBack = () => {
    navigate(-1);
  };

  return <StyledBackButton onClick={goBack}>Back</StyledBackButton>;
};

export default BackButton;
